import {StyleSheet} from 'react-native';

const styles = StyleSheet.create({
    headerContainer: {
        display: 'flex',
        textAlign: "center",
    },

    header: {
        backgroundColor: 'rgb(92, 92, 92)',
        padding: '1.5%',
        fontSize: '24px',
        color: 'white',
        marginTop: '15px',
    },

    spaces: {
        display: "flex",
        flex: 'wrap',
        padding: '2%',
        fontSize: '16px',
    },

    buttonContainer:{
        borderRadius: '50px',
        fontSize: '16px',
        padding: "20px",
        margin: "3px",
    },

    buttons: {
        borderRadius: '3%',
        fontSize: '16px',
        padding: "15px",
        margin: "20px",
    },

});

export default styles;
